import React from "react";
import washedClean from "./washed_clean.jpg";
import outboundBlack from "./outbound_black.png";
function Home() {
  return (
    <div id="Stories" className="layout">
      <>
        <h1>Eden Fuller</h1>
        <h2>portfolio</h2>
        <div className="about-content">
          <p>
            <a href="https://onward.on-running.com">
              <span className="about-link">
                On Running - Onward <img src={outboundBlack}></img>
              </span>
            </a>
            <br />
            eCommerce site for On Running's resale program. Lead front-end
            engineer (entire site).
          </p>
        </div>
      </>
    </div>
  );
}
export default Home;
